import './App.css';

function Heading() {
  return <h1>Hello michal fingerut</h1>;
}
function App() {
  return (
    <div className="App">
      <h1 className="header">Created by michal fingerut</h1>
      <p>Copyright {new Date().getFullYear()}</p>
    </div>
  );
}

export default App;
